    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Mingo, Pilot Knob, and Ozark Cavefish NWRs for
    the next 15 years. This plan outlines the refuges' vision and purpose and describes
    how Mingo, Pilot Knob, and Ozark Cavefish NWRs will contribute to the overall mission
    of the Refuge System. The plan provides an introduction to the refuges, an overview
    of the CCP process, information about the environment, information about the management
    direction, and strategies for implementation. Key planning issues include: wildlife,
    vegetation, public use, flooding, cultural resources, funding, and habitat management.",nt"owner_org":
